;; gorilla-repl.fileformat = 1

;; **
;;; # Population Demo
;;; 
;;; This is a demonstration of a report using Gorilla REPL.
;;; 
;;; As a gratuitous example of using LaTeX to show mathematical forumlas in Gorilla REPL, here's one:
;;; 
;;; $$\[ \frac{d}{dx}\left( \int_{0}^{x} f(u)\,du\right)=f(x). \]$$
;; **

;; @@
(ns population-report
  (:require [gorilla-repl.table :as table]
            [gorilla-plot.core :as plot]
            [gorilla-demo.us-population-graph :as graph]
            [gorilla-demo.us-population-choropleth :as choropleth]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
