;; **
;;; # Multiple Domains (Louisiana, Missouri, Vermont 2005-2006)
;;; 
;;; You can also display different domains of data.  This was done above on the larger map, but it can be done on the smaller maps, too.  Here you have different views of the data:
;;; 
;;; 1) The first column is the origin data with the default color scheme.
;;; 2) The second column shows the calculation of the delta.
;;; 3) The third column shows the calculation of a delta percentage.
;;; 
;;; ## Delta Percentage
;;; 
;;; Just showing movement of people can be misleading.  If 10 people left a county of 100, that's a massive loss.  However, if 10 people left a county of 1,000,000, that's not as tramatic.  Showing what percentage of people are leaving relative to each county tells a better story.
;;; 
;;; This time-frame corrisponds to Hurricane Katrina.  You can see massive movement away from the coastal areas of Louisiana.
;;; 
;;; More importantly, if you look at St. Bernard Parish you can see on the delta map that fewer people moved away compared to Orleans Parish (just to the north).  However, if you look at the delta percentage map, you can see that 77% of St. Bernard Parish moved out compared to Orlean's 53%.
;;; 
;;; Similarly, if you look at Missouri, it appears a lot of people left St. Louis.  However, when you look at the delta percentage, you can see that the change was not as significant relative to the population.
;; **

;; @@
