;; **
;;; # Population Change (2000-2015)
;;; 
;;; Here we can see how the population of Illinois and Louisiana changed from 2000 to 2015.  The graph starts at 2001 since it requires 2000 to calculate the delta percentage.
;;; 
;;; The important thing to note here is all the maps have been set a given domain of -8% to 8%.  That way all graphs are showing the same story.  The default of the map is to show a domain from min to max of a given data set.  The data set changes from state to state, year to year and that can be misleading when comparing graphs.  By setting the domain to a fixed level, the shades between the lower and upper levels are consistent and have the same meaning.
;; **

